import logo from './logo.svg';
import './mainstruct.css';

function mainstruct() {
  return (
    <div className="mainstruct">
              <header className="mainstruct-header">
                <img src={logo} className="mainstruct-logo" alt="logo" />
                <p>
                  Edit <code>src/mainstruct.js</code> and save to reload.
                </p>
                <a
                  className="mainstruct-link"
                  href="https://reactjs.org"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  Learn React
                </a>
              </header>
            </div>
  );
}

export default mainstruct;
